import { useEffect, useState } from "react";
import { Link, useNavigate } from 'react-router-dom';
export const Auth = ({children}) => {
    const navigate = useNavigate();
    const [user, setUser] = useState("");
    useEffect(() => {
        setUser(localStorage.getItem('userInfo'));
        // const cat = 
        if (user) navigate("/");
        navigate("/login");
    }, [user])
    return (
        {children}
    )
}
